import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'

function Table(props) {
  console.log(props.getData)
  return (
    <div className="">
    {props.getData.map((work)=>
        <div className="each-task">
            <span >                     
            {work.uid}
            <div id="date">

            </div>
            <div id="time">
            {work.time}
            </div>
            </span>

      </div>
    )}

</div>
  );
}

export default Table;
